window.onload=()=>{document.querySelector("#roomSubmit").onclick=e=>{(async e=>{e.preventDefault();const o={name:document.querySelector("#roomName").value,theme:document.querySelector("#roomTheme").value,amtMembers:document.querySelector("#roomMembers").value};console.log(JSON.stringify(o));const r=await fetch("/createRoom",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify(o)}),t=await r.json();t.redirect&&(window.location=t.redirect),t.error&&console.log("ERROR: "+t.error)})(e)}};